import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios";

export default function Register() {
  const [formValues, setFormValues] = useState({});
  const [formError, setFormError] = useState({});
  const navigate = useNavigate();

  const onChangeHandler = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });

    if (name === "cpassword") {
      setFormError({
        ...formError,
        password: value !== formValues.password ? "*Passwords do not match" : "",
      });
    } else if (name === "password" && formValues.cpassword) {
      setFormError({
        ...formError,
        password: formValues.cpassword !== value ? "*Passwords do not match" : "",
      });
    }
  };

  const submit = async (e) => {
    e.preventDefault();
    if (Object.keys(formError).length > 0) {
      alert("Please fix the errors before submitting.");
      return;
    }

    try {
      const response = await axios.post(`${apiUrl}/user/`, formValues);
      if (response.status === 200) {
        alert("Registration successful!");
        navigate("/login");
      }
    } catch (error) {
      console.error("Registration error:", error);
      alert("Registration failed. Please try again.");
    }
  };

  return (
    <div
      style={{
        height: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center", // Align items to the center
        backgroundColor: "lightgray",
      }}
    >
      <div
        className="container mt-5"
        style={{
          maxWidth: "400px", // Constrain the width of the form container
          boxShadow: "2px 3px 8px black",
          backgroundColor: "lightblue",
          padding: "20px",
          borderRadius: "10px",
        }}
      >
        <h3
          className="text-dark"
          style={{
            textAlign: "center", // Center the header
            marginBottom: "20px",
          }}
        >
          Registration
        </h3>
        <form
          onSubmit={submit}
          style={{
            textAlign: "center", // Align the text and inputs to the center
          }}
        >
          {/* First Name */}
          <div className="mb-3">
            <label htmlFor="first_name">First Name</label>
            <input
              required
              type="text"
              name="first_name"
              id="first_name"
              placeholder="First Name"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", margin: "0 auto" }}
            />
          </div>

          {/* Last Name */}
          <div className="mb-3">
            <label htmlFor="last_name">Last Name</label>
            <input
              type="text"
              name="last_name"
              id="last_name"
              placeholder="Last Name"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", margin: "0 auto" }}
            />
          </div>

          {/* Username */}
          <div className="mb-3">
            <label htmlFor="username">Username</label>
            <input
              required
              type="text"
              name="username"
              id="username"
              placeholder="Username"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", margin: "0 auto" }}
            />
          </div>

          {/* Mobile Number */}
          <div className="mb-3">
            <label htmlFor="mobile">Mobile Number</label>
            <input
              required
              type="text"
              name="mobile_no"
              id="mobile"
              placeholder="Mobile Number"
              pattern="[6789][0-9]{9}"
              title="Please enter a valid phone number"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", margin: "0 auto" }}
            />
          </div>

          {/* Email */}
          <div className="mb-3">
            <label htmlFor="email">Email</label>
            <input
              required
              type="email"
              name="email"
              id="email"
              placeholder="Email"
              className="form-control"
              onChange={onChangeHandler}
              style={{ width: "100%", margin: "0 auto" }}
            />
          </div>

          {/* Password */}
          <div className="mb-3">
            <label htmlFor="password">Password</label>
            <input
              required
              type="password"
              className="form-control"
              name="password"
              id="password"
              placeholder="Password"
              onChange={onChangeHandler}
              style={{ width: "100%", margin: "0 auto" }}
            />
          </div>

          {/* Confirm Password */}
          <div className="mb-3">
            <label htmlFor="cpassword">Confirm Password</label>
            <input
              required
              type="password"
              name="cpassword"
              placeholder="Confirm Password"
              className="form-control"
              id="cpassword"
              onChange={onChangeHandler}
              style={{ width: "100%", margin: "0 auto" }}
            />
            <p className="text-danger" style={{ marginTop: "5px" }}>
              {formError.password}
            </p>
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            className="btn btn-primary"
            style={{
              width: "100%",
              marginTop: "10px",
            }}
          >
            Register
          </button>
        </form>
      </div>
    </div>
  );
}
